import React from "react";
import styled from "styled-components";
import SubjectItem from "./SubjectItem";

const SubjectListBlock = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;
`;

function SubjectList({ input, subjects, state }) {
  console.log(state);
  return (
    <SubjectListBlock>
      <div>
        {subjects.map(subject => (
          <SubjectItem text={subject.name} done={false} />
        ))}
      </div>
    </SubjectListBlock>
  );
}

export default SubjectList;
